CREATE TABLE `s_audit_result` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `audit_record_id` int(10) unsigned NOT NULL,
  `factory_area_id` int(10) unsigned NOT NULL COMMENT '车间id,s_factory_area.id',
  `factory_area_name` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '车间名称',
  `complete_date` date NOT NULL COMMENT '提交日期',
  `auditor_name` varchar(20) COLLATE utf8mb4_bin NOT NULL COMMENT '审核员名称',
  `auditor` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '主管名称',
  `item_count_total` int(11) NOT NULL COMMENT '主管检测项目总数',
  `position_score` decimal(10,2) unsigned NOT NULL COMMENT '位置分数',
  `clean_score` decimal(10,2) unsigned NOT NULL COMMENT '清洁度得分',
  `keep_score` decimal(10,2) unsigned NOT NULL COMMENT '维持得分',
  `unqualified_item_list` json NOT NULL COMMENT '不合格的检查项',
  `unqualified_url_list` json NOT NULL COMMENT '不合格的图片',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `modify_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
