/*Table structure for table `s_improve` */

DROP TABLE IF EXISTS `s_improve`;

CREATE TABLE `s_improve` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` varchar(255) NOT NULL COMMENT '提出人id',
  `user_name` varchar(32) NOT NULL COMMENT '提出人name',
  `department` bigint(20) NOT NULL COMMENT '提出人部门id',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '1-审批中,2-审核通过,3-驳回',
  `title` varchar(50) NOT NULL COMMENT '主题',
  `remark` varchar(255) NOT NULL COMMENT '描述',
  `action_remark` varchar(255) DEFAULT NULL COMMENT '措施描述',
  `proceed_remark` varchar(255) DEFAULT NULL COMMENT '收益描述',
  `finish` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已完成',
  `improve_type_id` int(10) unsigned NOT NULL COMMENT '改善类型id',
  `department_type` int(10) unsigned DEFAULT NULL COMMENT '部门分类,1-质量部,2-IPPI',
  `improve_name` varchar(50) DEFAULT NULL COMMENT '改善类型名称',
  `process` varchar(1024) NOT NULL COMMENT '审核流程',
  `next_user_id` varchar(255) DEFAULT NULL COMMENT '下一个审批人id',
  `next_user_name` varchar(32) DEFAULT NULL COMMENT '下一个审批人名称',
  `rejected` varchar(50) DEFAULT NULL COMMENT '驳回原因',
  `version` bigint(20) NOT NULL DEFAULT '0',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `modify_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

