/*Table structure for table `s_point_audit_record` */

DROP TABLE IF EXISTS `s_point_audit_record`;

CREATE TABLE `s_point_audit_record` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `audit_record_id` int(10) unsigned NOT NULL COMMENT 's_audit_record.id',
  `status` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '1-提交检测结果,2-提交评分',
  `point_id` int(10) unsigned NOT NULL COMMENT 's_monitoring_point.id',
  `area_name` varchar(50) NOT NULL COMMENT '区域名称,s_monitoring_poin.area_name',
  `serial_number` varchar(10) NOT NULL COMMENT '序号,s_monitoring_poin.serial_number',
  `auditor` varchar(50) NOT NULL COMMENT '主管名称',
  `item_count` int(10) unsigned NOT NULL COMMENT '检测项目数',
  `item_count_total` int(10) unsigned NOT NULL COMMENT '主管检测项目总数',
  `position_score` int(10) unsigned NOT NULL DEFAULT '10' COMMENT '位置分数',
  `position_remark` varchar(1024) DEFAULT NULL COMMENT '位置得分备注',
  `position_image` varchar(1024) DEFAULT NULL COMMENT '位置得分照片,',
  `clean_score` int(10) unsigned NOT NULL DEFAULT '10' COMMENT '清洁度得分',
  `clean_remark` varchar(1024) DEFAULT NULL COMMENT '清洁度备注',
  `clean_image` varchar(1024) DEFAULT NULL COMMENT '清洁度照片',
  `keep_score` int(10) unsigned NOT NULL DEFAULT '10' COMMENT '维持得分',
  `before_id` int(10) unsigned NOT NULL COMMENT '上次检查记录',
  `image_score` decimal(10,2) unsigned NOT NULL DEFAULT '70.00' COMMENT '图片得分',
  `total_score` decimal(10,2) DEFAULT '100.00' COMMENT '总分',
  `item_list` json NOT NULL COMMENT '检测项结果',
  `unqualified_url_list` json NOT NULL COMMENT '不合格的图片',
  `unqualified_item_list` json NOT NULL COMMENT '不合格的检查项',
  `is_deleted` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否删除,0-未删除,1-已删除',
  `version` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '版本号',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `modify_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_audit_record_id_point_id` (`audit_record_id`,`point_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1717 DEFAULT CHARSET=utf8 COMMENT='检查点审核记录';

